import React from 'react';
type Person = {
    id: number
    firstName: string
    lastName: string
}

type PersonListProps = {
    nameList: Person[]
}

const PersonList = (props: PersonListProps) => {

    return (
        <div>
            <h3>List of Persons :</h3>
            {props.nameList.map((person) => {
                return (
                    <div key={person.id}>
                        <p>Name: {}</p>
                    </div>
                )
            })}
        </div>
    );
};

export default PersonList;
